questionvariables.text:
aa:rand(9)+2;
bb:rand_with_prohib(-6,6,[0]);
ee:rand([-10,-2]);
dd:rand([1,10]);
quest:ee<=bb-aa*x and bb-aa*x<dd;
ta:x>(bb-dd)/aa and x<=(bb-ee)/aa;
/*Express answer in terms of real intervals*/
int_1: oc(-inf,((bb-ee)/aa));
int_2: oo(((-dd+bb)/aa),inf);
int_3:%intersection(int_1,int_2);
int_4:oc(((-dd+bb)/aa),((bb-ee)/aa));
